import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom';
function Home() {
    const navigate = useNavigate();
    useEffect(() =>{
        const token = sessionStorage.getItem("token");
        if( !token){
            navigate("/")
        }
    },[])
  return (
    <div>Home</div>
  )
}

export default Home
